import React from "react";

const DetailUser = () => {
  return (
    <div
      className="box"
      style={{
        width: "50%",
        margin: "0 auto",
        marginTop: "50px",
        paddingBottom: "70px",
      }}
    >
      <div class="columns">
        <div class="column is-1">Nama : </div>
        <div class="column">Second column</div>
      </div>
      <div class="columns">
        <div class="column is-1">Email : </div>
        <div class="column">Second column</div>
      </div>
      <div class="columns">
        <div class="column is-1">Nama : </div>
        <div class="column">Second column</div>
      </div>
    </div>
  );
};

export default DetailUser;
